import React from "react";
import { Button } from "rebass";
import theme from "../theme";

const primaryButton = ({ children, theme: { buttons } }) => {
  return (
    <Button height="50px" width="100px" variant="primary">
      {children}
    </Button>
  );
};

export default primaryButton;
